import React from 'react'

const Login = () => {
  return (
    <div className="row">
      <div className="col-lg-5 col-md-7 mx-auto">
      <div className="card border-success shadow-lg my-2">
      <div className="card-header border-bottom border-success"></div>
      </div>
      </div>
    </div>
  )
}

export default Login
